import axios from 'axios';
import React, { useState, useEffect } from 'react';

const ListProjects = (props) => {
  const [userId, setUserId] = useState(props.userId);
  
  useEffect(() => {
    setUserId(props.userId);
  }, [props.userId]);
  
  const getTable = () => {
    console.log('hi');
    const stateJson=JSON.stringify(this.state);
    console.log('before sending'+stateJson);
    axios.post('http://127.0.0.1:5000/getProject', JSON.parse(stateJson))
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.error(error);
      });
    }

  useEffect(() => {
    getTable();
  }, [userId]);  

  return (
    <div>
      <p>This is from ListProjects file: {userId}</p>
    </div>
  );
}

export default ListProjects;
